import { configureStore } from "@reduxjs/toolkit";
import ApiSlice from "./reducers/ApiSlice";
import testSlice from "./reducers/testSlice";


const Store = configureStore({
    reducer:{
        test:testSlice,
        api:ApiSlice
    }
});

export default Store;
